import {
  ContainerFormLogin,
  FormLogin,
  InputProfile,
  ContainerAllButtons,
  ContainerButton,
  ButtonLogin,
  ButtonRegister,
} from "./styles";
const Login = () => {

  return (
    <>
      <Header />

        <ContainerFormLogin>
          <ToastContainer />

          <FormLogin onSubmit={nill}>
            <InputProfile
              placeholder="Email"
              name="email"
              type="text"
              ref={emailRef}
              required
            ></InputProfile>
            <InputProfile
              placeholder="Password"
              name="passwUser"
              type="password"
              ref={passwordRef}
              required
            ></InputProfile>
            <ContainerAllButtons>
              <ContainerButton>
                <ButtonLogin type="submit">Login</ButtonLogin>
              </ContainerButton>
              <ContainerButton>
                <ButtonRegister type="button" onClick={registerButton}>
                  Register
                </ButtonRegister>
              </ContainerButton>
            </ContainerAllButtons>
          </FormLogin>
        </ContainerFormLogin>

      <Footer />
    </>
  );
};

export default Login;
